//import * as firebase from "firebase/app";
import { getAuth, signInWithPopup, GoogleAuthProvider } from "firebase/auth";
import { ButtonGoogle } from "../../pages/stylesGlobal/styles";
import firebaseConfig from '../config/firebase';
import iconGoogle from '../../assets/Imag/iconeGoogle.jpg'

const provider = new GoogleAuthProvider();

const AuthGoogle = () => {
  const auth = getAuth(firebaseConfig);

  const LogarComGoogle = () => {
    signInWithPopup(auth, provider)
      .then((result) => {
        const credential = GoogleAuthProvider.credentialFromResult(result);
        const token = credential.accessToken;
        const user = result.user;
        //console.log( token, user)
        console.log(user)
      }).catch((error) => {
        const credential = GoogleAuthProvider.credentialFromError(error);
        //console.log(credential)
      });

  }

  const actionLoginGoogle = () => {
    LogarComGoogle()
  }

  return (
    <>
      <ButtonGoogle onClick={actionLoginGoogle}>
        <div><img src={iconGoogle} alt="Alguma coisa"/></div>
        Autenticar com Google
      </ButtonGoogle>
    </>
  )
}
export default AuthGoogle;
